- input: "TEXT\x1CC00386904\x1C.TEXT\x1C\x1CF3XA\x1CFor the 2008 election cycle, we
    donated $10,095.27 to Joe Donnelly for Congress. We gave $4,000 in Nov 2006 after
    the election, $1,000 in June 2007, and $5,000 in March of 2008.  We hosted a fundraiser
    in September 2007 for the Congressman and an in-kind contribution put us over
    the top. The Donnelly campaign has been made aware of this, and is issuing us
    a refund for $95.27, but we have not received this check. It will be noted in
    our next reporting cycle. Thank you very much."
